const styles = {
  root: {
    display: 'flex',
    justifyContent: 'center',
    width: '100%',
    backgroundColor: '#121212',
  },
  bar: {
    paddingTop: 20,
    textAlign: 'center',
    backgroundColor: '#121212',
    color: 'white',
  },
  jobListBox: {
    flexWrap: 'wrap',
    marginTop: 20,
    marginBottom: -10,
  },
  banner: {
    marginTop: 20,
    maxWidth: '100%',
  },
};

export default styles;
